INSERT INTO `t_document` VALUES ('14', '传阅中', '天猫', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 36px; white-space: normal;\">各位领导：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 36px; white-space: normal;\">　　我因家中有事，于XX年XX月XX日至XX年XX月XX日，请假XX天，<span style=\"background-color: rgb(250, 192, 143);\">请批准。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 36px; white-space: normal;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 36px; white-space: normal;\">　　 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;请假人：天猫</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 36px; white-space: normal;\">　 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2016年5月9日</p><p><br/></p>', '请假', '2016-05-09 22:57:23', null, null, null, '1', null, null);
INSERT INTO `t_document` VALUES ('15', '传阅中', '人民政府', '<p style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">××市人民政府</p><p style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　关于表彰计划生育先进集体和先进工作者的通报各县(市、区)人民政府，市属各部门?</p><p style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　“九五”计划期间，我市各级党委、政府和有关部门高度重视计划生育工作，认真贯彻省计划生育条例，切实加强对计划生育工作的领导，全面完成了省下达的“九五”人口计划和各项计划生育指标任务。二零××年度，全市人口出生率降到5%，平均生育率为087，低于全国、全省水平。这是全市各级干部、计划生育工作者和全市人民共同努力的结果。为了进一步推动我市计划生育工作的深入开展，市人民政府决定授予××县等三十五个单位“全市计划生育先进集体”光荣称号，授予×××等四十五位同志”全市计划生育先进工作者”光荣称号。希望受到表彰的单位和个人，要戒骄戒躁，继续努力，为我市计划生育工作向深层次、高质量发展做出新的贡献。二零××年，是“十五”计划的第一年，各级政府和广大干部要全面贯彻落实好党的十五届四中全会精神，继续把计划生育工作放在更加重要的地位，坚持不懈地抓下去，切实加强领导，坚持按《条例》规定依法管理，大力加强基层基础工作，力争我市“十五”期间人口出生率控制在5%以内，为本世纪末实现我市人口控制在四百万以下的目标而努力奋斗。</p><p style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　附：××市计划生育先进集体、先进工作者名单。(略)××市人民政府(盖章)二零××年×月×五日</p><p><br/></p>', '表彰性通报', '2016-05-10 09:54:06', null, null, null, '1', null, null);
